window.bookSummaryJSON = "<p>My name is Vinna, and it all started with a routine fight in the middle of nowhere Nevada that ended up changing everything.</p> <p>I found...family. My chosen. Power. Vengeance.</p> <p>Now I find myself in the middle of nowhere Russia, my destiny within walking distance, and I have no idea what I'll find.</p> <p>Will I be welcomed? Feared? Despised? We're about to find out.</p> <p>Sentinel City, ready or not here I come.</p> <p><b>Contains mature themes.</b></p>"; 
